%[text] %[text:anchor:T_4C892D6E] # **Wind Rose Chart Examples**
%[text] **Overview**
%[text] The `WindRoseChart` displays the distribution and intensities of a windspeed values, arranged by the corresponding wind directions. It is similar to a histogram or stacked bar chart, except that the data is shown in a circular (rather than linear) display, enabling easy recognition of important wind directions. The radial values in the chart represent the percentage of observations falling into each combined speed/direction bin. 
%[text] The chart data comprises a table `WindData` containing two variables:
%[text] - a nonnegative numeric vector `Speed`, and
%[text] - a numeric vector `Direction` (taking values between 0 and 360 degrees).  \
%[text] To create the graphics, the chart performs binning on the windspeed and wind direction data, similar to the 2D binning performed by [`histcounts2`](<matlab: doc("histcounts2")>). However, due to the need to wrap directions correctly at 360Â°, the chart bins the observations lying in each wind direction interval separately using [`histcounts`](<matlab: doc("histcounts")>). The binning process is as follows.
%[text] - The speed data is divided into bins, using the chart parameter `SpeedBinEdges`. This is a strictly increasing vector of the form $\\mathbf{e}=\[0, v\_1, v\_2, \\dots, v\_n, \\infty\]$, where $v\_i\<v\_{i+1}$ for $i=1, 2, \\dots, n-1$. The first and last elements of $\\mathbf{e}$ are 0 and $\\infty$, respectively, to ensure that all windspeeds present in the data set are included in the wind rose.
%[text] - The direction data is divided into 36 bins of equal angular size (10 degrees).
%[text] - The chart property `ObservationCounts` contains the number of observations in each speed-direction bin. These counts are also converted to percentages and accumulated in the speed direction for display in the wind rose. \
%[text] ![WindRoseChart.png](text:image:9a2e)
%[text]{"align":"center"} 
%[text] **Documentation**
%[text] - [`histcounts`](<matlab: doc("histcounts")>): histogram bin counts
%[text] - [`histcounts2`](<matlab: doc("histcounts2")>): bivariate histogram bin counts
%[text] - [`patch`](<matlab: doc("patch")>): plot one or more filled polygonal regions \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] %[text:anchor:H_63D961A6] ## Load the observed wind data.
%[text] The data comprises a 2-column table with wind speed and wind direction measurements.
load( fullfile( chartsRoot(), "data", "Wind.mat" ) )
%[text] Display a preview of the data table.
disp( head( W ) ) %[output:24bf7b11]
%%
%[text] %[text:anchor:H_672169F9] ## Create a figure for the chart.
f = exampleFigure( "Name", "WindRoseChart Example" ); %[output:33c4c547]
%%
%[text] %[text:anchor:H_FC172C28] ## Create the chart.
WRC = WindRoseChart( "Parent", f, "WindData", W ); %[output:33c4c547]
%%
%[text] %[text:anchor:H_EB13BD59] ## Annotate the chart.
%[text] The `WindRoseChart` has the `title` method for annotation.
title( WRC, "Wind Rose Chart" ) %[output:42f517b5]
%[text] The legend is managed by the chart, and the chart provides a large number of legend-related properties for customizing the legend appearance.
set( WRC, "LegendBox", "on", ... %[output:group:5bae3f0e] %[output:42f517b5]
    "LegendNumColumns", 2 ) %[output:group:5bae3f0e] %[output:42f517b5]
%%
%[text] %[text:anchor:H_D77F3703] ## Modify the windspeed bins.
%[text] We can adjust the bins used to discretize the windspeed values. For example, we might want to use more bins in the lower range of windspeeds.
WRC.SpeedBinEdges = [0:2.5:15, 20:5:30, Inf]; %[output:106e9d1a]
drawnow()
%%
%[text] %[text:anchor:H_0DE0F42D] ## Adjust the appearance of the polar histogram.
%[text] The polar histogram is built from `patch` objects, and the chart exposes several of their decorative properties for customization purposes.
%[text] Change the colormap used by the chart.
numSpeedBins = numel( WRC.SpeedBinEdges ) - 1;
WRC.FaceColors = cool( numSpeedBins ); %[output:3a3c7d5c]
%[text] Modify the patches.
set( WRC, "FaceAlpha", 0.75, "EdgeColor", "none" ) %[output:3a3c7d5c]
%%
%[text] %[text:anchor:H_9C2C3A65] ## Customize the chart's text objects.
%[text] The chart manages both the radial percentage labels and the wind direction labels. We can customize their appearance as required.
%[text] For example, we can change the wind direction along which the radial labels are displayed.
WRC.RadialLabelDirection = "S"; %[output:4ba74e88]
%[text] The direction labels can be moved in and out using the `DirectionLabelOffset` property.
WRC.DirectionLabelOffset = WRC.DirectionLabelOffset - 0.1; %[output:4ba74e88]
%[text] There are also a number of decorative properties.
set( WRC, "DirectionLabelFontSize", 9, ... %[output:group:8aab4076] %[output:4ba74e88]
    "RadialLabelFontAngle", "italic" ) %[output:group:8aab4076] %[output:4ba74e88]
%%
%[text] %[text:anchor:H_4EAAD4BC] ## Reduce the chart data.
%[text] Take the first 500 samples from the data table.
WRC.WindData = W(1:500, :); %[output:45d9667b]
%%
%[text] %[text:anchor:H_06E58BEB] ## Reset the chart data to the original table.
WRC.WindData = W; %[output:6555768b]
%%
%[text] %[text:anchor:H_31DA5CB4] ## Chart interactivity.
%[text] The patches making up the polar histogram are interactive. When the user clicks on a patch, a text box containing information on the speed-direction bin appears. Clicking again hides the text box.
%%
